// Flatten transcript from $json.data.(sentences|sentences.sentences)
// Outputs one item: { text, markdown, lineCount, speakers, pathUsed }

const INCLUDE_TIMESTAMPS = true;
const MERGE_CONSECUTIVE  = true;

// --- helpers ---
const clean = s => (typeof s === 'string' ? s.replace(/\s+/g, ' ').trim() : '');
const pickText = seg =>
  clean(seg.text) ||
  clean(seg.ai_filters && seg.ai_filters.text_cleanup) ||
  clean(seg.raw_text) ||
  '';

const fmtTS = (sec) => {
  const n = Number(sec);
  if (!Number.isFinite(n) || n < 0) return '';
  const m = Math.floor(n / 60);
  const s = Math.round(n % 60);
  return `${String(m).padStart(2,'0')}:${String(s).padStart(2,'0')}`;
};

// --- locate sentences array strictly under "data" ---
let raw = $json.data;
try {
  if (typeof raw === 'string') raw = JSON.parse(raw);
} catch (_) {}

let segsArr = null;
let pathUsed = '';

if (raw && raw.sentences) {
  if (Array.isArray(raw.sentences.sentences)) {
    segsArr = raw.sentences.sentences; pathUsed = 'data.sentences.sentences';
  } else if (Array.isArray(raw.sentences)) {
    segsArr = raw.sentences; pathUsed = 'data.sentences';
  }
}

// Last-resort: shallow scan under data for an array of sentence-like objects
if (!Array.isArray(segsArr) && raw && typeof raw === 'object') {
  const scan = (obj, path = ['data']) => {
    for (const k of Object.keys(obj)) {
      const v = obj[k];
      if (Array.isArray(v) && v.length && typeof v[0] === 'object') {
        const o = v[0] || {};
        if ('speaker_name' in o || 'speaker_id' in o) {
          if ('text' in o || 'raw_text' in o || (o.ai_filters && 'text_cleanup' in o.ai_filters)) {
            return { arr: v, path: [...path, k].join('.') };
          }
        }
      }
      if (v && typeof v === 'object') {
        const found = scan(v, [...path, k]);
        if (found) return found;
      }
    }
    return null;
  };
  const found = scan(raw);
  if (found) { segsArr = found.arr; pathUsed = found.path; }
}

if (!Array.isArray(segsArr)) {
  return [{
    json: {
      warning: "No sentence array found under 'data'.",
      dataType: typeof $json.data,
      pathTried: ['data.sentences.sentences','data.sentences'],
      availableKeysAtRoot: Object.keys($json || {}),
      hint: "If 'data' is a string, ensure it contains { sentences: { sentences: [...] } }."
    }
  }];
}

// --- normalise, sort, merge ---
let segs = segsArr
  .map((s, i) => ({
    index: (s.index != null ? Number(s.index) : i),
    speaker_name: clean(s.speaker_name) || (s.speaker_id != null ? `Speaker ${s.speaker_id}` : 'Unknown'),
    speaker_id: s.speaker_id,
    start_time: (s.start_time != null ? Number(s.start_time) : Number.POSITIVE_INFINITY),
    end_time: (s.end_time != null ? Number(s.end_time) : Number.POSITIVE_INFINITY),
    text: pickText(s)
  }))
  .filter(s => s.text)
  .sort((a, b) => {
    const ak = Number.isFinite(a.start_time) ? a.start_time : a.index;
    const bk = Number.isFinite(b.start_time) ? b.start_time : b.index;
    return ak - bk;
  });

if (MERGE_CONSECUTIVE && segs.length) {
  const merged = [];
  let cur = { ...segs[0] };
  for (let i = 1; i < segs.length; i++) {
    const s = segs[i];
    if (s.speaker_name === cur.speaker_name) {
      cur.text = `${cur.text} ${s.text}`.replace(/\s+/g, ' ').trim();
      cur.end_time = Number.isFinite(s.end_time) ? s.end_time : cur.end_time;
    } else {
      merged.push(cur);
      cur = { ...s };
    }
  }
  merged.push(cur);
  segs = merged;
}

// --- build output ---
const speakers = new Set();
const lines = segs.map(s => {
  const ts = INCLUDE_TIMESTAMPS && Number.isFinite(s.start_time) ? `[${fmtTS(s.start_time)}] ` : '';
  speakers.add(s.speaker_name);
  return `${ts}${s.speaker_name}: ${s.text}`;
});

const text = lines.join('\n');
const markdown = lines.map(l => `- ${l}`).join('\n');

return [{
  json: {
    text,
    markdown,
    lineCount: lines.length,
    speakers: Array.from(speakers),
    pathUsed
  }
}];
